import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";


var containerElement = document.getElementById("reactContainer");
var reactRoot = ReactDOM.createRoot(containerElement);

reactRoot.render(
    <React.UseStrict>
        <App />
    </React.UseStrict>
);
